import React from 'react';
import './App.css';
import { Layout, Header, Navigation, Drawer, Content, Footer } from 'react-mdl';
import Main from './components/main';
import { Link } from 'react-router-dom';

function App() {
  return (
  <div className="demo-big-content">
      <Layout>
          <Header className="header-color" title="Kyle S. Gloria" scroll style={{color: 'black'}}>
              <Navigation className="nav-bar">
                  <Link to="/resume" style={{color: 'black'}}>Resume</Link>
                  <Link to="/projects" style={{color: 'black'}}>Projects</Link>
                  <Link to="/aboutme" style={{color: 'black'}}>About Me</Link>
                  <Link to="/contact" style={{color: 'black'}}>Contact</Link>
              </Navigation>
          </Header>
          <Drawer title="Title">
              <Navigation>
                  <Link to="/resume">Resume</Link>
                  <Link to="/projects">Projects</Link>
                  <Link to="/aboutme">About Me</Link>
                  <Link to="/contact">Contact</Link>
              </Navigation>
          </Drawer>
          <Content>
              <div className="page-content" />
              <Main/>
          </Content>
      </Layout>
  </div>

  );
}

export default App;
